TABLE_HEADER = '<style>\n/*\n * I add this to html files generated with pandoc.\n */\n\nhtml {\n  font-size: 100%;\n  overflow-y: scroll;\n  -webkit-text-size-adjust: 100%;\n  -ms-text-size-adjust: 100%;\n}\n\nbody {\n  color: #444;\n  font-family: Georgia, Palatino, \'Palatino Linotype\', Times, \'Times New Roman\', serif;\n  font-size: 12px;\n  line-height: 1.7;\n  padding: 1em;\n  margin: auto;\n  max-width: 42em;\n  background: #fefefe;\n}\n\na {\n  color: #0645ad;\n  text-decoration: none;\n}\n\na:visited {\n  color: #0b0080;\n}\n\na:hover {\n  color: #06e;\n}\n\na:active {\n  color: #faa700;\n}\n\na:focus {\n  outline: thin dotted;\n}\n\n*::-moz-selection {\n  background: rgba(255, 255, 0, 0.3);\n  color: #000;\n}\n\n*::selection {\n  background: rgba(255, 255, 0, 0.3);\n  color: #000;\n}\n\na::-moz-selection {\n  background: rgba(255, 255, 0, 0.3);\n  color: #0645ad;\n}\n\na::selection {\n  background: rgba(255, 255, 0, 0.3);\n  color: #0645ad;\n}\n\np {\n  margin: 1em 0;\n}\n\nimg {\n  max-width: 100%;\n}\n\nh1, h2, h3, h4, h5, h6 {\n  color: #111;\n  line-height: 125%;\n  margin-top: 2em;\n  font-weight: normal;\n}\n\nh4, h5, h6 {\n  font-weight: bold;\n}\n\nh1 {\n  font-size: 2.5em;\n}\n\nh2 {\n  font-size: 2em;\n}\n\nh3 {\n  font-size: 1.5em;\n}\n\nh4 {\n  font-size: 1.2em;\n}\n\nh5 {\n  font-size: 1em;\n}\n\nh6 {\n  font-size: 0.9em;\n}\n\nblockquote {\n  color: #666666;\n  margin: 0;\n  padding-left: 3em;\n  border-left: 0.5em #EEE solid;\n}\n\nhr {\n  display: block;\n  height: 2px;\n  border: 0;\n  border-top: 1px solid #aaa;\n  border-bottom: 1px solid #eee;\n  margin: 1em 0;\n  padding: 0;\n}\n\npre, code, kbd, samp {\n  color: #000;\n  font-family: monospace, monospace;\n  _font-family: \'courier new\', monospace;\n  font-size: 0.98em;\n}\n\npre {\n  white-space: pre;\n  white-space: pre-wrap;\n  word-wrap: break-word;\n}\n\nb, strong {\n  font-weight: bold;\n}\n\ndfn {\n  font-style: italic;\n}\n\nins {\n  background: #ff9;\n  color: #000;\n  text-decoration: none;\n}\n\nmark {\n  background: #ff0;\n  color: #000;\n  font-style: italic;\n  font-weight: bold;\n}\n\nsub, sup {\n  font-size: 75%;\n  line-height: 0;\n  position: relative;\n  vertical-align: baseline;\n}\n\nsup {\n  top: -0.5em;\n}\n\nsub {\n  bottom: -0.25em;\n}\n\nul, ol {\n  margin: 1em 0;\n  padding: 0 0 0 2em;\n}\n\nli p:last-child {\n  margin-bottom: 0;\n}\n\nul ul, ol ol {\n  margin: .3em 0;\n}\n\ndl {\n  margin-bottom: 1em;\n}\n\ndt {\n  font-weight: bold;\n  margin-bottom: .8em;\n}\n\ndd {\n  margin: 0 0 .8em 2em;\n}\n\ndd:last-child {\n  margin-bottom: 0;\n}\n\nimg {\n  border: 0;\n  -ms-interpolation-mode: bicubic;\n  vertical-align: middle;\n}\n\nfigure {\n  display: block;\n  text-align: center;\n  margin: 1em 0;\n}\n\nfigure img {\n  border: none;\n  margin: 0 auto;\n}\n\nfigcaption {\n  font-size: 0.8em;\n  font-style: italic;\n  margin: 0 0 .8em;\n}\n\ntable {\n  margin-bottom: 2em;\n  border-bottom: 1px solid #ddd;\n  border-right: 1px solid #ddd;\n  border-spacing: 0;\n  border-collapse: collapse;\n}\n\ntable th {\n  padding: .2em 1em;\n  background-color: #eee;\n  border-top: 1px solid #ddd;\n  border-left: 1px solid #ddd;\n}\n\ntable td {\n  padding: .2em 1em;\n  border-top: 1px solid #ddd;\n  border-left: 1px solid #ddd;\n  vertical-align: top;\n}\n\n.author {\n  font-size: 1.2em;\n  text-align: center;\n}\n\n@media only screen and (min-width: 480px) {\n  body {\n    font-size: 14px;\n  }\n}\n@media only screen and (min-width: 768px) {\n  body {\n    font-size: 16px;\n  }\n}\n@media print {\n  * {\n    background: transparent !important;\n    color: black !important;\n    filter: none !important;\n    -ms-filter: none !important;\n  }\n\n  body {\n    font-size: 12pt;\n    max-width: 100%;\n  }\n\n  a, a:visited {\n    text-decoration: underline;\n  }\n\n  hr {\n    height: 1px;\n    border: 0;\n    border-bottom: 1px solid black;\n  }\n\n  a[href]:after {\n    content: " (" attr(href) ")";\n  }\n\n  abbr[title]:after {\n    content: " (" attr(title) ")";\n  }\n\n  .ir a:after, a[href^="javascript:"]:after, a[href^="#"]:after {\n    content: "";\n  }\n\n  pre, blockquote {\n    border: 1px solid #999;\n    padding-right: 1em;\n    page-break-inside: avoid;\n  }\n\n  tr, img {\n    page-break-inside: avoid;\n  }\n\n  img {\n    max-width: 100% !important;\n  }\n\n  @page :left {\n    margin: 15mm 20mm 15mm 10mm;\n}\n\n  @page :right {\n    margin: 15mm 10mm 15mm 20mm;\n}\n\n  p, h2, h3 {\n    orphans: 3;\n    widows: 3;\n  }\n\n  h2, h3 {\n    page-break-after: avoid;\n  }\n}\n</style>\n<style type="text/css">\n#popup {\n\tdisplay: none;\n\tposition: fixed;\n}\n\n\n</style>\n<script type="text/javascript">\n<!--\n\tfunction getPopup() {\n\t\treturn document.getElementById(\'popup\');\n\t}\n\nfunction showPopup(anchor, img_src) {\n\tvar popup = getPopup();\n\t// add image\n\tpopup.innerHTML = "<img src=\'" + img_src + "\' alt=\'\' width=600 />";\n\n\t// position popup\n\tpopup.style.top = (anchor.offsetTop + anchor.offsetHeight + 5) + \'px\';\n\tpopup.style.left = anchor.offsetLeft + \'px\';\n\tpopup.style.display = \'block\';\n}\n\nfunction hidePopup() {\n\tvar popup = getPopup();\n\tpopup.style.display = \'none\';\n}\n-->\n</script>\n'
